import React from 'react'
import './RightSide.css'
import { FaUserCircle,FaUserFriends,FaHome,FaUsers} from 'react-icons/fa';
import { FiLogOut} from 'react-icons/fi';
import '../LeftSide/LeftSide.css';
const RightSide = () => {
  return (
    <div>
      <div className='user-page-card'>
         <button type='submit'><i><FaUserCircle size={'1.2rem'}/></i> Profile</button>
          <button type='submit'><i><FaUserFriends size={'1.2rem'} /></i> Members</button>
          <button type='submit'><i><FaUsers size={'1.2rem'}/></i> Community</button>
          <button type='submit'><i><FaHome size={'1.2rem'} /></i> Home</button>
          <button type='submit'><i><FiLogOut size={'1.2rem'}/></i> Log out</button>
      </div>
    </div>
  )
}

export default RightSide
